import React from 'react'

class Questions2 extends React.Component {
    render() {
        const props = this.props

        if (props.currentStep !== 2) {
          return null;
        }

        return (
            <div>
                <p>Tick the things you like</p>
                <label htmlFor="input-21">Two - Question one</label>
                <input id="input-21" type="checkbox" onChange={ props.onUpdateSelected } defaultChecked={Object.values(this.props.selected).indexOf('input-21') > -1} /><br />
                <label htmlFor="input-22">Two - Question two</label>
                <input id="input-22" type="checkbox" onChange={ props.onUpdateSelected } defaultChecked={Object.values(this.props.selected).indexOf('input-22') > -1} /><br />
                <label htmlFor="input-23">Two - Question three</label>
                <input id="input-23" type="checkbox" onChange={ props.onUpdateSelected } defaultChecked={Object.values(this.props.selected).indexOf('input-23') > -1} /><br />
            </div>
        )
    }
}

export default Questions2
